  return (
    <div className="flex flex-col min-h-screen overflow-hidden">

      {/*  Site header */}
      <ResponsiveNavBar />

      {/*  Page content */}
      <main className="flex flex-row py-44 px-8 justify-center text-black font-sans">

        <div className='bg-red-600 flex justify-center align-middle py-16 w-96 right-0' >hello</div>
        <div className='bg-red-50 flex items-center justify-center align-middle py-16 w-96 '> 
                <div className="border-t border-gray-300 flex-grow mr-3" aria-hidden="true"></div>
                  <div className="text-gray-600 italic font-semibold">Or</div>
                  <div className="border-t border-gray-300 flex-grow ml-3" aria-hidden="true"></div></div>
        <div className='bg-red-200 flex justify-center align-middle py-16 w-96 left-0 '> hi</div>
        {/*  Page sections */}


      </main>

      {/*  Site footer */}


    </div>
  );
}

export default Drive;
